window.bookSummaryJSON = "<p>In the dungeon diving business and life, things haven't been going Amabel's way. Passed up in progressing up the tiers of power by friends and former teammates she finds herself at the end of her rope and purse adventuring wise.</p> <p>In that tight spot, she finds herself making choices and agreements she wouldn't usually make.</p> <p><i>Progression of Power</i> is a short dungeon diving story. Itcontains some light crude language.</p>"; 
